CREATE TABLE key_dates (
    key_date_id UUID PRIMARY KEY,
    contract_id UUID,
    key_date_type TEXT,
    key_date DATE
);

CREATE TABLE contracts (
    contract_id INT PRIMARY KEY,
    supplier_name VARCHAR(50),
    contract_date DATE,
    expiry_date DATE
);

CREATE TABLE key_dates (
    date_id SERIAL PRIMARY KEY,
    contract_id INT,
    type VARCHAR(50),
    date_value DATE
);
